import React from "react";
import "../cards/Cards.css";
import CardItem from "../cartItem/CardItem";
import CardItem2 from "../cartItem/CardItem2";
import CardItem3 from "../cartItem/CardItem3";
import karaoke from "../../images/categories/Karaoke.jpg";
import shisha from "../../images/categories/shisha.jpg";
import malismo from "../../images/categories/minimalismo.jpg";
import covid from "../../images/categories/borshtCovid.jpg";
import menu from "../../images/categories/menu.jpg";
import delivery from "../../images/categories/salad.jpg";
import art1 from "../../images/female-faces/Female/Female-05.svg";
import art2 from "../../images/female-faces/Female/Female-07.svg";
import art3 from "../../images/female-faces/Female/Female-16.svg";

import SwiperCore, { Navigation, Pagination, A11y } from "swiper";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/swiper.scss";
import "swiper/components/navigation/navigation.scss";
import "swiper/components/pagination/pagination.scss";
import "swiper/components/scrollbar/scrollbar.scss";

function Cards() {
  SwiperCore.use([Navigation, Pagination, A11y]);
  return (
    <section id="cards" className="cards">
      <div className="cards-text">
        <h3>Authentic Russian Cuisine</h3>
        <h2>Our restaurants collections</h2>
      </div>

      {/* CAROUSEL START*/}
      <section className="swiper__container">
        <Swiper
          breakpoints={{
            // when window width is >= 640px
            320: {
              width: 640,
              slidesPerView: 1,
            },
            640: {
              width: 640,
              slidesPerView: 1,
            },
            // when window width is >= 768px
            768: {
              width: 768,
              slidesPerView: 2,
            },
            900: {
              width: 700,
              slidesPerView: 2,
            },
          }}
          spaceBetween={50}
          slidesPerView={3}
          navigation
          onSlideChange={() => console.log("slide change")}
          onSwiper={(swiper) => console.log(swiper)}
        >


          <SwiperSlide>
            <CardItem2 className=""
              image={art1}
              title={"Food & Drink"}
              subheading={"yesplease"}
              path="/services"
            />
          </SwiperSlide>

        </Swiper>
      </section>
      {/* CAROUSEL END*/}

      <div className="cards__container">
        <div className="cards__wrapper">
          <ul className="feed">
            <CardItem2
              image={art1}
              title={"Food & Drink"}
              subheading={"yesplease"}
              path="/services"
            />
            <CardItem2
              image={art2}
              title={"Fresh Shishas"}
              subheading={"yesplease"}
              path="/services"
            />
            <CardItem2
              image={art3}
              title={"Covid Survival"}
              subheading={"yesplease"}
              path="/services"
            />
          </ul>
        </div>
      </div>
    </section>
  );
}

export default Cards;
